import React from "react";
import TodoItem from "./todoItem";
import todosData from "./todosData";

function Main() {
	let todoDataComponents = todosData.map((todoData) => {
		<TodoItem key={todoData.id} tData />;
	});

	return (
		<div className='main'>
			<div className='todo-list'></div>
		</div>
	);
}

export default Main;
